  false,\n\t\"url\": null,\n\t\"notes\": \" n        This report provides the results
  from (1) an impact evaluation of the MCA's Rural Water Point Implementation Program
  ('RWPIP') in Nampula and (2) an evaluation of the SSSS in Cabo Delgado.  nnThe objective
  of the impact evaluation of the MCA's RWPIP in Nampula is to examine the extent
  to which the program objectives have been realized. Rigorous impact evaluations
  should allow causal claims to be made about program interventions and observed changes
  in outcome indicators, typically by comparing the beneficiaries of the program to
  a non-beneficiary comparison group. nThe objective of the SSSS study in Cabo Delgado
  was to qualitatively analyze the performance of the systems from a financial, technical,
  and managerial perspective. The research was driven by the hypothesis that in larger,
  more densely settled communities, the SSSS and private operator model better serves
  water users' needs, is more cost effective, and more sustainable over the long term,
  as compared to the a handpump with water committee management approach.n      \",\n\t\"license_title\":
